import React from 'react';
import { Container } from 'react-bootstrap';
import ImgFullScreen from '../imgFullScreen/imgFullScreen';
import { ReactComponent as Arrows } from '/src/assets/arrows-up-down-left-right.svg'

export default function ImgContainer({ usedIds, getSrc, getPhotographer }) {
    return (
        <Container fluid>
            <div className='d-flex flex-wrap justify-content-center box-container'>
                {usedIds.map(index => {
                    return (
                        <div className='box' key={index}>
                            <img className='img-fluid' alt='random image' src={getSrc(index, 'medium')} ></img>
                            <div>
                                <p>{getPhotographer(index)}</p>
                                <ImgFullScreen title={getPhotographer(index)} src={getSrc(index, 'large2x')}> <Arrows/> </ImgFullScreen>
                            </div>
                        </div>
                    )
                })}
            </div>
        </Container>
    );
};
